import classes from "./UserList.module.css"

const UserList=(props)=>{
    let arr= Array.from(props.userInputs);
    return(
        <div className={classes.users}>
            {arr.map((data)=>(
                <h2>{data.UserName}</h2>
            ))}
        </div>
    )
}
export default UserList;
